import logo from './logo.svg';
import React from "react";
import './App.css';
import {
  Dropdown,
  DropdownButton,
  Container,
  Row,
  Col,
  Modal,
  Button
} from "react-bootstrap";

class Car extends React.Component {
  constructor(props) {
    super(props);
    this.state = {

        title:'', 
        photo:'',
        description:'',
        short_description:''

    }
  }


  goTo () {
    console.log("Go to")
}



render(){
var test ={}
    if (this.props.location.length()>0)
    test=  <div>     Title: {this.props.location.state.title}
    Photo: <img src={this.props.location.state.photo} alt="Test"/> 
    Description: {this.props.location.state.description}
    Short Short_Description: {this.props.location.state.short_description}
    <Button onClick={this.goTo}></Button>          </div>


  return (
    <div className="App">
     {test}
    </div>
  );}
}

export default Car;
